// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma experimental ABIEncoderV2;

/******************************************************************************\
* EIP-2535 Diamond Standard: https://eips.ethereum.org/EIPS/eip-2535
* Implementation of : https://github.com/mudgen/diamond-1/blob/master/contracts/Diamond.sol
*
* 
/******************************************************************************/

import "@openzeppelin/contracts/introspection/IERC165.sol";
import "./interfaces/IERC173.sol";
import "./interfaces/IDiamondCut.sol";
import "./interfaces/IDiamondLoupe.sol";
import "./libraries/LibQualla.sol";

contract Qualla {
    struct DiamondArgs {
        address owner;
    }

    constructor(
        IDiamondCut.FacetCut[] memory _diamondCut,
        DiamondArgs memory _args
    ) payable {
        LibQualla.diamondCut(_diamondCut, address(0), new bytes(0));
        LibQualla.setContractOwner(_args.owner);

        LibQualla.DiamondStorage storage ds = LibQualla.diamondStorage();

        // adding ERC165 data
        ds.supportedInterfaces[type(IERC165).interfaceId] = true;
        ds.supportedInterfaces[type(IDiamondCut).interfaceId] = true;
        ds.supportedInterfaces[type(IDiamondLoupe).interfaceId] = true;
        ds.supportedInterfaces[type(IERC173).interfaceId] = true;
    }
}

